import { Container } from "react-bootstrap";
import "./Home.css";
function Home() {
  return (
    <Container style={{ backgroundColor: "#84a59e" }}>
      <p>Hello</p>
      <p>Hello</p>
      <p>Hello</p>
      <p>Hello</p>
      <p>Hello</p>
    </Container>
  );
}

export default Home;
